import React from 'react';
import './Navbar.css';
import {Link} from 'react-router-dom';

export default function Navbar(){
    return (
        <div>
            <img src = "logo192.png" align = "" alt = "sai"></img>
            <div className='navbar'>
                <Link to = '/' className='navbarLink'>Home</Link>
                <div className='align'>
                    <Link to='/con' className='navbarLink'>Contact</Link>
                    <Link to='/acc' className='navbarLink'>Account</Link>
                    <Link to='/log' className='navbarLink'>Sign in</Link>
                </div>
                <Link to='/best' className='navbarLink'>BestSelled </Link>
                <form id = "example">
                    <input type="text" className = 'navy' name="search" placeholder="Search.." />
                </form>
            </div>
        </div>
    )
}
